import React from "react";
import { Typography, Button, Card, CardActions, CardContent, Divider, Grid, Container, CardMedia, Popover, Box } from '@material-ui/core'
import {useState} from "react"
import useStyles from "../styles";
import DropDown from "./subcomponents/DropDownExpertise"

import participants from "../data/Participants";

const Expertise = () => {
    const classes = useStyles()
    const [anchor, setAnchor] = useState(null);
    const openPopover = (event) => {
        setAnchor(event.currentTarget)
    }
    return (
        <Container maxWidth="md">
            <Grid container spacing={2} direction="column">
            <Grid item xs={12}></Grid>
            <Grid item xs={12}></Grid>
            <Grid item xs={12}>
                <Typography variant="h2" align="center" color="textPrimary">
                    ProMiSE expertise information data
                </Typography>
            </Grid>
            <Grid item xs={12}>
                <Divider p={5}/>
            </Grid>
            <Grid item xs={12}>
                <DropDown/>
            </Grid>
            <Grid item xs={12}></Grid>
            <Grid item xs={12}></Grid>
            <Grid container spacing={4}>
                {participants.map((participant) => (   
                <Grid item key={participant.name} xs={12} sm={6} md={4}>
                        <Card className={classes.card}>
                            <CardMedia 
                                className = {classes.cardMedia}
                                image={require('../data/participant_profiles/'+String(participant.name)+'.jpg')} 
                            />
                            <CardContent className={classes.cardContent}>
                                <Typography variant="h5">
                                    {participant.name}
                                </Typography>
                                <Typography>
                                    This is a media card. You can describe the content here
                                </Typography>
                            </CardContent>
                            <CardActions>
                                <Button size="small" color="primary" onClick={openPopover}>View</Button>
                                <Popover 
                                    open={Boolean(anchor)} 
                                    anchorEl={anchor} anchorOrigin={{vertical: "top", horizontal: "center"}} 
                                    transformOrigin={{vertical: "center", horizontal: "center"}}
                                    onClose={() => setAnchor(null)}
                                    >
                                <Box
                                    component="img"
                                    sx={{
                                    height: 233,
                                    width: 350,
                                    maxHeight: { xs: 233, md: 167 },
                                    maxWidth: { xs: 350, md: 250 },
                                    }}
                                    alt="The house from the offer."
                                    src="https://images.unsplash.com/photo-1512917774080-9991f1c4c750?auto=format&w=350&dpr=2"
                                />
                                </Popover>
                            </CardActions>
                        </Card>
                    </Grid>
                    ))}
            </Grid>
            <Grid item xs={12}></Grid>
            <Grid item xs={12}></Grid>
            <Grid item xs={12}>
                <Divider p={5}/>
            </Grid>
            </Grid>
        </Container>
    );
}

export default Expertise;
